import { Link } from 'react-router-dom'

const Userlist = ({ users }) => {
    return (
        <div>
            <h2>Users</h2>
            {users.map((user) => (
                <div key={user.id}>
                    <Link to={`/users/${user.id}`}>
                        {user.name} {user.blogs.length} <strong>blogs</strong>
                    </Link>
                </div>
            ))}
        </div>
    )
}

export default Userlist
